import React from 'react';



class DrumVisualizer extends React.Component{
    shouldComponentUpdate(nextProps, nextState){
        return nextProps.keyPressed === ''? false: true;
    }

    render(){
        console.log('------------------------');
        console.log(this.props.playList);
        console.log(this.props.keyPressed);        
        
        return(
            <button>
                {               
                    this.props.playList === 'BANK 1' && this.props.keyPressed !== ''? 
                        this.props.firstPlayList.filter(x => x.key === this.props.keyPressed)[0].id :
                    this.props.playList === 'BANK 2' && this.props.keyPressed !== ''? 

                        this.props.secondPlayList.filter(x => x.key === this.props.keyPressed)[0].id: 'wddqw'  
                }
            </button>
        )
    }
}


export default DrumVisualizer;
